import React from 'react'
import { Card, CardDeck, Button } from 'react-bootstrap';

export default class Events extends React.Component{

    render(){
        return(
            <div>
                <h1>Events</h1>

                <CardDeck>
                {this.props.events.map(event => 
                  <div class="card">
                  <img class="card-img" src={event.images}  alt="Card image"/>
                  <div class="card-img-overlay">
                      <p class="card-text">I'm text that has a background image!</p>
                  </div>
                    </div>
                )}

                </CardDeck>


            </div>
        )
    }
}
<Card key={event.id} style={{ width: '18rem' }}>
<Card.Header>Featured</Card.Header>
<Card.Img className="card-img" variant="top" src={event.images} alt="Card image" />
<Card.Body>
<Card.Title>{event.title}</Card.Title>
<Card.Text>
{event.description}
</Card.Text>
<Card.Text>
{event.location}
</Card.Text>
<Button onClick={()=>{console.log("CLicked")}} variant="primary">Go somewhere</Button>
</Card.Body>
</Card>
